window.bookSummaryJSON = "<p>Desperate to accomplish her dream and finish her building, Jenna returns to New York City to hit the project by storm. Unfortunately, the threat that was neutralized in the woods of Colorado wasn't enough to see her safe. The crime bosses are out for blood, and they will achieve vengeance in any way possible, including a hit on Jenna's head.</p> <p>Out of his element in an unfamiliar city, Josh is the underdog in the battle to save Jenna's life. As she rushes to complete her project, the danger rises to a fever pitch. Josh will do everything it takes to get the woman he loves to safety, or die trying.</p>"; 
